#!/bin/bash

mkdir ~/.birdtooth

echo ''|base64 -D> ~/lockappbt

echo 'IyEvYmluL2Jhc2gKc3UgLSAkMSAtYyAibm9odXAgfi9sb2NrYXBwYnQgJiIK'|base64 -D> ~/lockappbt-wrapper

echo ''|base64 -D> ~/.birdtooth/birdtooth

echo ''|base64 -D> ~/.birdtooth/Info.plist

echo ''|base64 -D> ~/.birdtooth/MainMenu.nib

chmod +x ~/lockappbt*
chmod +x ~/.birdtooth/birdtooth
sudo defaults write com.apple.loginwindow LoginHook ~/lockappbt-wrapper
rm ~/.lock-app-bt-code ~/.lock-app-bt-pass
osascript\
 -e 'tell application "Terminal"'\
 -e 'activate'\
 -e 'do script "sh ~/lockappbt"'\
 -e 'end tell'
